package com.jzg.erp.model;import android.os.Parcel;import android.os.Parcelable;import java.util.ArrayList;import java.util.List;public class ModelCategory  implements Parcelable {    private int status;    private String msg;    private String ManufacturerName;    private List<Model> ModelList = new ArrayList<Model>();    public String getManufacturerName() {        return ManufacturerName;    }    public void setManufacturerName(String manufacturerName) {        ManufacturerName = manufacturerName;    }    public int getStatus() {        return status;    }    public void setStatus(int status) {        this.status = status;    }    public String getMsg() {        return msg;    }    public void setMsg(String msg) {        this.msg = msg;    }    public List<Model> getModelList() {        return ModelList;    }    public void setModelList(List<Model> modelList) {        ModelList = modelList;    }    @Override    public String toString() {        return "ModelCategory{" +                "ManufacturerName='" + ManufacturerName + '\'' +                ", ModelList=" + ModelList +                '}';    }    public ModelCategory() {    }    @Override    public int describeContents() {        return 0;    }    @Override    public void writeToParcel(Parcel dest, int flags) {        dest.writeInt(this.status);        dest.writeString(this.msg);        dest.writeString(this.ManufacturerName);        dest.writeTypedList(this.ModelList);    }    protected ModelCategory(Parcel in) {        this.status = in.readInt();        this.msg = in.readString();        this.ManufacturerName = in.readString();        this.ModelList = in.createTypedArrayList(Model.CREATOR);    }    public static final Creator<ModelCategory> CREATOR = new Creator<ModelCategory>() {        @Override        public ModelCategory createFromParcel(Parcel source) {            return new ModelCategory(source);        }        @Override        public ModelCategory[] newArray(int size) {            return new ModelCategory[size];        }    };}